import { makeStyles } from "@mui/styles";

export const useStyles = makeStyles({
  blockSubmit:{
    display:'flex',
    marginTop:20,
    alignItems:'center',
    justifyContent:'space-between'
  },
  createProfile:{
    backgroundColor:'rgba(25, 118, 210,0.2)',
    color:'#363e45',
    textAlign:"center",
    marginTop:10,
    marginBottom:10
  }
})
